script: |
  super -f text -I q11784.spq | sort > q11784.out

inputs:
  - name: q11784.spq
    data: |
      SELECT ALL + col2 + + col0 FROM tab1 (FORMAT parquet) WHERE 93 + 5 BETWEEN + + col0 AND - col2 * - + col1 * col1 + - col1;
  - name: tab1

outputs:
  - name: q11784.out
    data: |
      144
      147
      159
